@testset "1.1.1.3 (a+b x)^m (c+d x)^n (e+f x)^p" begin
    @variables A, B, a, b, c, d, e, f, m, n, p, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*x)^n*(c+d*x)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*x)^n*(c+d*x)^p*when*b*c+a*d=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*x)^n*(c+d*x)^p*when*b*c+a*d=0=#


    @test_int [x^2/((-1 + x)^2*(1 + x)^2), x, 3, x/(2*(1 - x^2)) - atanh(x)/2]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*x)^1*(c+d*x)^p*when*b*c+a*d=0=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(a + b*x)*(a*c - b*c*x)^3*x^2, x, 2, (1/3)*a^4*c^3*x^3 - (1/2)*a^3*b*c^3*x^4 + (1/3)*a*b^3*c^3*x^6 - (1/7)*b^4*c^3*x^7]
    @test_int [(a + b*x)*(a*c - b*c*x)^3*x^1, x, 2, (1/2)*a^4*c^3*x^2 - (2/3)*a^3*b*c^3*x^3 + (2/5)*a*b^3*c^3*x^5 - (1/6)*b^4*c^3*x^6]
    @test_int [(a + b*x)*(a*c - b*c*x)^3*x^0, x, 2, -((a*c^3*(a - b*x)^4)/(2*b)) + (c^3*(a - b*x)^5)/(5*b)]

    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^1, x, 2, -2*a^3*b*c^3*x + (2/3)*a*b^3*c^3*x^3 - (1/4)*b^4*c^3*x^4 + a^4*c^3*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^2, x, 2, -((a^4*c^3)/x) + a*b^3*c^3*x^2 - (1/3)*b^4*c^3*x^3 - 2*a^3*b*c^3*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^3, x, 1, -((c^3*(a - b*x)^4)/(2*x^2))]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^4, x, 2, -((a^4*c^3)/(3*x^3)) + (a^3*b*c^3)/x^2 - b^4*c^3*x + 2*a*b^3*c^3*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^5, x, 2, -((a^4*c^3)/(4*x^4)) + (2*a^3*b*c^3)/(3*x^3) - (2*a*b^3*c^3)/x - b^4*c^3*log(x)]

    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^6, x, 2, -((a^4*c^3)/(5*x^5)) + (a^3*b*c^3)/(2*x^4) - (a*b^3*c^3)/x^2 + (b^4*c^3)/x]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^7, x, 2, -((a^4*c^3)/(6*x^6)) + (2*a^3*b*c^3)/(5*x^5) - (2*a*b^3*c^3)/(3*x^3) + (b^4*c^3)/(2*x^2)]
    @test_int [(a + b*x)*(a*c - b*c*x)^3/x^8, x, 2, -((a^4*c^3)/(7*x^7)) + (a^3*b*c^3)/(3*x^6) - (a*b^3*c^3)/(2*x^4) + (b^4*c^3)/(3*x^3)]


    @test_int [(a + b*x)*(a*c - b*c*x)^4*x^4, x, 2, (1/5)*a^5*c^4*x^5 - (1/2)*a^4*b*c^4*x^6 + (2/7)*a^3*b^2*c^4*x^7 + (1/4)*a^2*b^3*c^4*x^8 - (1/3)*a*b^4*c^4*x^9 + (1/10)*b^5*c^4*x^10]
    @test_int [(a + b*x)*(a*c - b*c*x)^4*x^3, x, 2, (1/4)*a^5*c^4*x^4 - (3/5)*a^4*b*c^4*x^5 + (1/3)*a^3*b^2*c^4*x^6 + (2/7)*a^2*b^3*c^4*x^7 - (3/8)*a*b^4*c^4*x^8 + (1/9)*b^5*c^4*x^9]

    @test_int [(a + b*x)*(a*c - b*c*x)^4*x^2, x, 2, -((2*a^3*c^4*(a - b*x)^5)/(5*b^3)) + (5*a^2*c^4*(a - b*x)^6)/(6*b^3) - (4*a*c^4*(a - b*x)^7)/(7*b^3) + (c^4*(a - b*x)^8)/(8*b^3)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4*x^1, x, 2, -((2*a^2*c^4*(a - b*x)^5)/(5*b^2)) + (a*c^4*(a - b*x)^6)/(2*b^2) - (c^4*(a - b*x)^7)/(7*b^2)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4*x^0, x, 2, -((2*a*c^4*(a - b*x)^5)/(5*b)) + (c^4*(a - b*x)^6)/(6*b)]

    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^1, x, 2, -3*a^4*b*c^4*x + a^3*b^2*c^4*x^2 + (2/3)*a^2*b^3*c^4*x^3 - (3/4)*a*b^4*c^4*x^4 + (1/5)*b^5*c^4*x^5 + a^5*c^4*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^2, x, 2, -((a^5*c^4)/x) + 2*a^3*b^2*c^4*x + a^2*b^3*c^4*x^2 - a*b^4*c^4*x^3 + (1/4)*b^5*c^4*x^4 - 3*a^4*b*c^4*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^3, x, 2, -((a^5*c^4)/(2*x^2)) + (3*a^4*b*c^4)/x + 2*a^2*b^3*c^4*x - (3/2)*a*b^4*c^4*x^2 + (1/3)*b^5*c^4*x^3 + 2*a^3*b^2*c^4*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^4, x, 2, -((a^5*c^4)/(3*x^3)) + (3*a^4*b*c^4)/(2*x^2) - (2*a^3*b^2*c^4)/x - 3*a*b^4*c^4*x + (1/2)*b^5*c^4*x^2 + 2*a^2*b^3*c^4*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^5, x, 2, -((a^5*c^4)/(4*x^4)) + (a^4*b*c^4)/x^3 - (a^3*b^2*c^4)/x^2 - (2*a^2*b^3*c^4)/x + b^5*c^4*x - 3*a*b^4*c^4*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^6, x, 2, -((a^5*c^4)/(5*x^5)) + (3*a^4*b*c^4)/(4*x^4) - (2*a^3*b^2*c^4)/(3*x^3) - (a^2*b^3*c^4)/x^2 + (3*a*b^4*c^4)/x + b^5*c^4*log(x)]

    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^7, x, 2, -((c^4*(a - b*x)^5)/(6*x^6)) - (7*b*c^4*(a - b*x)^5)/(30*a*x^5)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^8, x, 2, -((a^5*c^4)/(7*x^7)) + (a^4*b*c^4)/(2*x^6) - (2*a^3*b^2*c^4)/(5*x^5) - (a^2*b^3*c^4)/(2*x^4) + (a*b^4*c^4)/x^3 - (b^5*c^4)/(2*x^2)]
    @test_int [(a + b*x)*(a*c - b*c*x)^4/x^9, x, 2, -((a^5*c^4)/(8*x^8)) + (3*a^4*b*c^4)/(7*x^7) - (a^3*b^2*c^4)/(3*x^6) - (2*a^2*b^3*c^4)/(5*x^5) + (3*a*b^4*c^4)/(4*x^4) - (b^5*c^4)/(3*x^3)]


    @test_int [(a + b*x)*(a*c - b*c*x)^5*x^4, x, 2, (1/5)*a^6*c^5*x^5 - (2/3)*a^5*b*c^5*x^6 + (5/7)*a^4*b^2*c^5*x^7 - (5/9)*a^2*b^4*c^5*x^9 + (2/5)*a*b^5*c^5*x^10 - (1/11)*b^6*c^5*x^11]
    @test_int [(a + b*x)*(a*c - b*c*x)^5*x^3, x, 2, (1/4)*a^6*c^5*x^4 - (4/5)*a^5*b*c^5*x^5 + (5/6)*a^4*b^2*c^5*x^6 - (5/8)*a^2*b^4*c^5*x^8 + (4/9)*a*b^5*c^5*x^9 - (1/10)*b^6*c^5*x^10]

    @test_int [(a + b*x)*(a*c - b*c*x)^5*x^2, x, 2, -((a^3*c^5*(a - b*x)^6)/(3*b^3)) + (5*a^2*c^5*(a - b*x)^7)/(7*b^3) - (a*c^5*(a - b*x)^8)/(2*b^3) + (c^5*(a - b*x)^9)/(9*b^3)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5*x^1, x, 2, -((a^2*c^5*(a - b*x)^6)/(3*b^2)) + (3*a*c^5*(a - b*x)^7)/(7*b^2) - (c^5*(a - b*x)^8)/(8*b^2)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5*x^0, x, 2, -((a*c^5*(a - b*x)^6)/(3*b)) + (c^5*(a - b*x)^7)/(7*b)]

    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^1, x, 2, -4*a^5*b*c^5*x + (5/2)*a^4*b^2*c^5*x^2 - (5/4)*a^2*b^4*c^5*x^4 + (4/5)*a*b^5*c^5*x^5 - (1/6)*b^6*c^5*x^6 + a^6*c^5*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^2, x, 2, -((a^6*c^5)/x) + 5*a^4*b^2*c^5*x - (5/3)*a^2*b^4*c^5*x^3 + a*b^5*c^5*x^4 - (1/5)*b^6*c^5*x^5 - 4*a^5*b*c^5*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^3, x, 2, -((a^6*c^5)/(2*x^2)) + (4*a^5*b*c^5)/x - (5/2)*a^2*b^4*c^5*x^2 + (4/3)*a*b^5*c^5*x^3 - (1/4)*b^6*c^5*x^4 + 5*a^4*b^2*c^5*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^4, x, 1, -((c^5*(a - b*x)^6)/(3*x^3))]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^5, x, 2, -((a^6*c^5)/(4*x^4)) + (4*a^5*b*c^5)/(3*x^3) - (5*a^4*b^2*c^5)/(2*x^2) + 4*a*b^5*c^5*x - (1/2)*b^6*c^5*x^2 - 5*a^2*b^4*c^5*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^6, x, 2, -((a^6*c^5)/(5*x^5)) + (a^5*b*c^5)/x^4 - (5*a^4*b^2*c^5)/(3*x^3) + (5*a^2*b^4*c^5)/x - b^6*c^5*x + 4*a*b^5*c^5*log(x)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^7, x, 2, -((a^6*c^5)/(6*x^6)) + (4*a^5*b*c^5)/(5*x^5) - (5*a^4*b^2*c^5)/(4*x^4) + (5*a^2*b^4*c^5)/(2*x^2) - (4*a*b^5*c^5)/x - b^6*c^5*log(x)]

    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^8, x, 2, -((c^5*(a - b*x)^6)/(7*x^7)) - (4*b*c^5*(a - b*x)^6)/(21*a*x^6)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^9, x, 3, -((c^5*(a - b*x)^6)/(8*x^8)) - (5*b*c^5*(a - b*x)^6)/(28*a*x^7) - (5*b^2*c^5*(a - b*x)^6)/(168*a^2*x^6)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^10, x, 2, -((a^6*c^5)/(9*x^9)) + (a^5*b*c^5)/(2*x^8) - (5*a^4*b^2*c^5)/(7*x^7) + (a^2*b^4*c^5)/x^5 - (a*b^5*c^5)/x^4 + (b^6*c^5)/(3*x^3)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^11, x, 2, -((a^6*c^5)/(10*x^10)) + (4*a^5*b*c^5)/(9*x^9) - (5*a^4*b^2*c^5)/(8*x^8) + (5*a^2*b^4*c^5)/(6*x^6) - (4*a*b^5*c^5)/(5*x^5) + (b^6*c^5)/(4*x^4)]
    @test_int [(a + b*x)*(a*c - b*c*x)^5/x^12, x, 2, -((a^6*c^5)/(11*x^11)) + (2*a^5*b*c^5)/(5*x^10) - (5*a^4*b^2*c^5)/(9*x^9) + (5*a^2*b^4*c^5)/(7*x^7) - (2*a*b^5*c^5)/(3*x^6) + (b^6*c^5)/(5*x^5)]


    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^8, x, 2, -((a^7*c^6)/(7*x^7)) + (5*a^6*b*c^6)/(6*x^6) - (9*a^5*b^2*c^6)/(5*x^5) + (5*a^4*b^3*c^6)/(4*x^4) + (5*a^3*b^4*c^6)/(3*x^3) - (9*a^2*b^5*c^6)/(2*x^2) + (5*a*b^6*c^6)/x + b^7*c^6*log(x)]

    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^9, x, 2, -((c^6*(a - b*x)^7)/(8*x^8)) - (9*b*c^6*(a - b*x)^7)/(56*a*x^7)]
    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^10, x, 3, -((c^6*(a - b*x)^7)/(9*x^9)) - (11*b*c^6*(a - b*x)^7)/(72*a*x^8) - (11*b^2*c^6*(a - b*x)^7)/(504*a^2*x^7)]
    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^11, x, 4, -((c^6*(a - b*x)^7)/(10*x^10)) - (13*b*c^6*(a - b*x)^7)/(90*a*x^9) - (13*b^2*c^6*(a - b*x)^7)/(360*a^2*x^8) - (13*b^3*c^6*(a - b*x)^7)/(2520*a^3*x^7)]
    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^12, x, 2, -((a^7*c^6)/(11*x^11)) + (a^6*b*c^6)/(2*x^10) - (a^5*b^2*c^6)/x^9 + (5*a^4*b^3*c^6)/(8*x^8) + (5*a^3*b^4*c^6)/(7*x^7) - (3*a^2*b^5*c^6)/(2*x^6) + (a*b^6*c^6)/x^5 - (b^7*c^6)/(4*x^4)]
    @test_int [(a + b*x)*(a*c - b*c*x)^6/x^13, x, 2, -((a^7*c^6)/(12*x^12)) + (5*a^6*b*c^6)/(11*x^11) - (9*a^5*b^2*c^6)/(10*x^10) + (5*a^4*b^3*c^6)/(9*x^9) + (5*a^3*b^4*c^6)/(8*x^8) - (9*a^2*b^5*c^6)/(7*x^7) + (5*a*b^6*c^6)/(6*x^6) - (b^7*c^6)/(5*x^5)]


    #= ::Subsubsection:: =#
    #=p<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(e*x)^(m/2)*(a+b*x)^n*(c+d*x)^p*when*b*c+a*d=0=#


    @test_int [(e*x)^(5/2)/((a + b*x)*(a*c - b*c*x)), x, 6, -((2*e*(e*x)^(3/2))/(3*b^2*c)) - (a^(3/2)*e^(5/2)*atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(b^(7/2)*c) + (a^(3/2)*e^(5/2)*atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(b^(7/2)*c)]
    @test_int [(e*x)^(3/2)/((a + b*x)*(a*c - b*c*x)), x, 6, -((2*e*sqrt(e*x))/(b^2*c)) + (sqrt(a)*e^(3/2)*atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(b^(5/2)*c) + (sqrt(a)*e^(3/2)*atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(b^(5/2)*c)]
    @test_int [(e*x)^(1/2)/((a + b*x)*(a*c - b*c*x)), x, 5, -((sqrt(e)*atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(sqrt(a)*b^(3/2)*c)) + (sqrt(e)*atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(sqrt(a)*b^(3/2)*c)]
    @test_int [1/((e*x)^(1/2)*(a + b*x)*(a*c - b*c*x)), x, 5, atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e)))/(a^(3/2)*sqrt(b)*c*sqrt(e)) + atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e)))/(a^(3/2)*sqrt(b)*c*sqrt(e))]
    @test_int [1/((e*x)^(3/2)*(a + b*x)*(a*c - b*c*x)), x, 6, -(2/(a^2*c*e*sqrt(e*x))) - (sqrt(b)*atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(a^(5/2)*c*e^(3/2)) + (sqrt(b)*atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(a^(5/2)*c*e^(3/2))]
    @test_int [1/((e*x)^(5/2)*(a + b*x)*(a*c - b*c*x)), x, 6, -(2/(3*a^2*c*e*(e*x)^(3/2))) + (b^(3/2)*atan((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(a^(7/2)*c*e^(5/2)) + (b^(3/2)*atanh((sqrt(b)*sqrt(e*x))/(sqrt(a)*sqrt(e))))/(a^(7/2)*c*e^(5/2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*x)^n*(c+d*x)^p*when*b*c+a*d=0*and*m*symbolic=#


    @test_int [(e*x)^m*(1 + a*x)^4*(2 - 2*a*x)^3, x, 2, (8*(e*x)^(1 + m))/(e*(1 + m)) + (8*a*(e*x)^(2 + m))/(e^2*(2 + m)) - (24*a^2*(e*x)^(3 + m))/(e^3*(3 + m)) - (24*a^3*(e*x)^(4 + m))/(e^4*(4 + m)) + (24*a^4*(e*x)^(5 + m))/(e^5*(5 + m)) + (24*a^5*(e*x)^(6 + m))/(e^6*(6 + m)) - (8*a^6*(e*x)^(7 + m))/(e^7*(7 + m)) - (8*a^7*(e*x)^(8 + m))/(e^8*(8 + m))]
    @test_int [(e*x)^m*(1 + a*x)^3*(2 - 2*a*x)^2, x, 2, (4*(e*x)^(1 + m))/(e*(1 + m)) + (4*a*(e*x)^(2 + m))/(e^2*(2 + m)) - (8*a^2*(e*x)^(3 + m))/(e^3*(3 + m)) - (8*a^3*(e*x)^(4 + m))/(e^4*(4 + m)) + (4*a^4*(e*x)^(5 + m))/(e^5*(5 + m)) + (4*a^5*(e*x)^(6 + m))/(e^6*(6 + m))]
    @test_int [(e*x)^m*(1 + a*x)^2*(2 - 2*a*x)^1, x, 2, (2*(e*x)^(1 + m))/(e*(1 + m)) + (2*a*(e*x)^(2 + m))/(e^2*(2 + m)) - (2*a^2*(e*x)^(3 + m))/(e^3*(3 + m)) - (2*a^3*(e*x)^(4 + m))/(e^4*(4 + m))]
    @test_int [(e*x)^m/((1 + a*x)^1*(2 - 2*a*x)^2), x, 5, ((e*x)^(1 + m)*Hypergeometric2F1(2, (1 + m)/2, (3 + m)/2, a^2*x^2))/(4*e*(1 + m)) + (a*(e*x)^(2 + m)*Hypergeometric2F1(2, (2 + m)/2, (4 + m)/2, a^2*x^2))/(4*e^2*(2 + m))]
    @test_int [(e*x)^m/((1 + a*x)^2*(2 - 2*a*x)^3), x, 5, ((e*x)^(1 + m)*Hypergeometric2F1(3, (1 + m)/2, (3 + m)/2, a^2*x^2))/(8*e*(1 + m)) + (a*(e*x)^(2 + m)*Hypergeometric2F1(3, (2 + m)/2, (4 + m)/2, a^2*x^2))/(8*e^2*(2 + m))]
    @test_int [(e*x)^m/((1 + a*x)^3*(2 - 2*a*x)^4), x, 5, ((e*x)^(1 + m)*Hypergeometric2F1(4, (1 + m)/2, (3 + m)/2, a^2*x^2))/(16*e*(1 + m)) + (a*(e*x)^(2 + m)*Hypergeometric2F1(4, (2 + m)/2, (4 + m)/2, a^2*x^2))/(16*e^2*(2 + m))]


